import React, { Component } from 'react'
import {Switch,Route,Redirect} from 'react-router-dom'
import Search from './Search'

export default class User extends Component {
    render() {
        return (
            <div>
                <Switch>
                    <Route path="/user/search" component={Search}/>
                </Switch>
            </div>
        )
    }
}
